import React from 'react'

function TopProductsSingle( {data} ) {
  return (
    <div className='bg-[#fff] text-center items-center flex justify-center flex-col'>
        <h1>{data.title}</h1>
        <img className='w-fit' src={data.thumbnail} alt="image" />
    </div>
  )
}

export default TopProductsSingle
